Column.ValidationFormula:
LET $data := 
ARRAY_TRANSPOSE(
  ARRAY(
	EACH [Team Name], 
	EACH [Team UUID]
  )
); 

LET $editingTeamUUID := [Editing Team UUID];

LET $teamsNotBeingEdited := 
ARRAY_FIRST(
  ARRAY_TRANSPOSE(
    ARRAY_WHERE(
      $data, $(i, item) 
      ARRAY_INDEX($item, 2) <> $editingTeamUUID
    ) 
  )
);

RETURN 
IF( 
  ARRAY_INDEXOF(
	$teamsNotBeingEdited, 
	[Add - Team Name]
  ),
  "Team name must be unique", 

  ISBLANK(TRIM([Add - Team Name])), 
  "Team name must not be blank"
)

Binding.Expression:
LET $getIcon := $(iconName, colour)
(
  REPLACESUBSTRING(
	"currentColor", 
	HASH_GET([Icons], $iconName), 	
	$colour
  )
); 

RETURN "<div style='height: 30px;'  
	>" & CALL($getIcon, "Users", "#99A1AA") & "</div>"

FieldEntry.Formula:
LET $combined := 
ARRAY_CONCAT(
  [Removed Team UUIDs], 
  [Team UUID]#[LineNumber]
);

RETURN
ARRAY_WHERE(
  $combined, $(i, item) 
  $item <> NULL
)

